import React, { useEffect } from 'react'
import './App.css';
import Signin from './Components/Singin/Signin';
import {Routes, Route, Navigate} from 'react-router-dom'
import Items from './Components/Items/Items';
import { useDispatch, useSelector } from 'react-redux';
import { apis } from './Apis/apis';
import { getUser } from './Slices/usersSlice';
import { getUsersData } from './helpers/getUsersData';
import { filterUsersData } from './helpers/filterUsersData';
import Error from './Components/Error/Error';
import { usersType } from './types/Types';

const App = () => {

  const dispatch = useDispatch()
  const {current}: {current: usersType} = useSelector((state: any) => state.current)
console.log(current)
  useEffect(() => {
    const data = getUsersData(apis.users)
    data.then((response: any) => dispatch(getUser(filterUsersData(response))))
  }, [])

  return (
    <Routes>
      <Route path='/' Component={Signin}/>
      <Route path='/error' Component={Error}/>
      <Route path='/items' Component={Items}/>
      {/* {!!Object.keys(current).length ? <Route path='/items' Component={Items}/> : <Route path='/error' Component={Error}/>} */}
      <Route path="/items" element={ !!Object.keys(current).length ? <Navigate to="/items" /> : <Error /> }
/>;
    </Routes>
  )
}

export default App
